import * as React from 'react';
import styled from 'styled-components';

const Splash = styled.h1`
`

const FinePrint = styled.h3 `
  color: darkgrey;
`
const Embedded = styled.div `
  display: flex;
  justify-content: center;
  align-items: center;
`

const Icon = styled.a `
  display

`

const ContactMe: React.FC<{}> = (props) => {
  return (
    <div>
      <ul><Splash>Hello</Splash></ul>
      <ul><FinePrint>Contact me at</FinePrint></ul>
      <ul>
        <Embedded>
          <a style={{backgroundImage:"github.png", width:"200px", height:"200px"}} href="https://github.com/bcopp"/>
          <a style={{backgroundImage:"linkdln.png", width:"200px", height:"200px"}} href="https://www.linkedin.com/in/bcopp/"/>
          <a style={{backgroundImage:"mail.png", width:"200px", height:"200px"}} href="mailto:brendancopp@gmail.com"/>
        </Embedded>
      </ul>
    </div>
  )
}

export default ContactMe;
